import Costs from "./components/Costs/Costs";

const items = [
  {
    name: "MacBook",
    date: new Date(2023, 9, 5),
    price: 15000,
  },
  {
    name: "Jacket",
    date: new Date(2023, 9, 6),
    price: 3400,
  },
  {
    name: "Iphone",
    date: new Date(2023, 9, 5),
    price: 1500,
  },
]


function App() {
  return (
    <>
      <h1>Let's start learning React!</h1>
      <Costs items={items}/>
    </>
  );
}

export default App;
